import React from 'react'
import {Form} from 'antd'
import PropTypes from 'prop-types'

function CommentForm({post}) {
    return (
        <Form>
            <div>
                commentForm
            </div>
        </Form>
    )
}

CommentForm.propTypes={
    post: PropTypes.object.isRequired
}

export default CommentForm
